import React from 'react';
//mport '../App.css';
//mport { Button } from './Button';
import { Button } from '@material-ui/core';
import './HeroSection.css';
import video from '../../assets/waves.mp4'
import { Link, useLocation } from 'react-router-dom';
import lucir from '../../assets/lucir.png';



function VideoBackground() {
    const image = lucir;
    return (
        <div>
            <div className='hero-container'>   
                <video src={video} autoPlay loop muted />
                <span>WELCOME TO </span><img id="lucir" src={image} alt="Link to store" />
                <p id="intro">Welcome to the cleanest soap store on the internet. The ingredients that we use are selected to be the least processed, therefore taking less energy to produce, and polluting less. A choice to use our products is a choice to reduce waste in this world. We must all share the planet, and do so diligently. For a clean body, mind, soul, and Earth. </p>
                <Button component={Link} to="/shop" className='btn' variant="contained" color="secondary" style={{ maxWidth: '130px', maxHeight: '60px', minWidth: '130px', minHeight: '70px' }} >
                    Shop Now
                </Button>
            </div>

        </div>
    );
}

export default VideoBackground;
